function dataBackgroundImage() {
  $('[data-bgimg]').each(function () {
    var bgImgUrl = $(this).data('bgimg');
    $(this).css('background-image', 'url(' + bgImgUrl + ')');
  });
}

$(window).ready(function () {
  /*---canvas menu activation---*/
  $('.canvas_open').on('click', function () {
    $('.Offcanvas_menu_wrapper,.off_canvas_overlay').addClass('active');
  });
  $('.canvas_close,.off_canvas_overlay').on('click', function () {
    $('.Offcanvas_menu_wrapper,.off_canvas_overlay').removeClass('active');
  });
  /*---Off Canvas Menu---*/

  var offcanvas_main_menu = $('.offcanvas_main_menu'),
      offcanvas_sub_menu = offcanvas_main_menu.find('.sub-menu'); //offcanvas_sub_menu.parent().prepend('<span class="menu-expand"><i class="fa fa-angle-down"></i></span>');
  //offcanvas_sub_menu.slideUp();

  $('.offcanvas_main_menu .menu-item-has-children .menu-expand').on('click', function (e) {
    if ($(this).parent().hasClass('menu-open')) {
      $(this).parent().removeClass('menu-open');
    } else {
      $(this).parent().parent().find('.menu-item-has-children').removeClass('menu-open');
      $(this).parent().addClass('menu-open');
    }
  });
  /*---sticky menu---*/

  $(window).on('scroll', function () {
    var scroll = $(window).scrollTop();

    if (scroll < 255) {
      $(".sticky-header").removeClass("sticky");
      $(".sticky-logo").removeClass("sticky");
    } else {
      $(".sticky-header").addClass("sticky");
      $(".sticky-logo").addClass("sticky");
    }
  });
  $('table.tarifs a[data-toggle="modal"]').on('click', function () {
    var modal = $($(this).data('target'));
    modal.find('h3 span.final-time').html($(this).data('hours'));
    modal.find('h3 span.final-price').html($(this).data('price'));
  });
  $('.modal').on('shown.bs.modal', function (e) {
    $('.product_navactive').resize();
  });
  $('.modal').on('hidden.bs.modal', function () {
    if ($('.modal-backdrop').length && $('.modal-backdrop').first().is(':visible')) {
      $('.modal-backdrop').first().click();
    }
  });
  $('[data-target="#modal-bus"]').on('click', function () {
    var bus = $(this).parents('div.single_product');
    var modal = $('#modal-bus');
    modal.find('.bus_name').html(bus.find('h3.bus_name').html());

    for (var i = 1; i < 5; ++i) {
      if (!!bus.find('.image_stock .thumbs img').eq(i - 1).attr('src').length && !!bus.find('.image_stock .pictures img').eq(i - 1)) {
        modal.find('#tab' + i + 'a img').attr('src', bus.find('.image_stock .thumbs img').eq(i - 1).attr('src')).css('display', 'block');
        modal.find('#tab' + i + ' img').attr('src', bus.find('.image_stock .pictures img').eq(i - 1).attr('src')).css('display', 'block');
      } else {
        modal.find('#tab' + i + 'a img').css('display', 'none');
        modal.find('#tab' + i + ' img').css('display', 'none');
      }
    }

    setTimeout(function () {
      modal.find('.loading').css('visibility', 'hidden');
      modal.find('.modal_tab').css('visibility', 'visible');
    }, 500);
  });
  $('.product_navactive').owlCarousel({
    loop: true,
    autoplay: false,
    autoplayTimeout: 8000,
    items: 3,
    dots: false,
    responsiveClass: true,
    responsive: {
      0: {
        items: 1
      },
      250: {
        items: 2
      },
      480: {
        items: 3
      },
      768: {
        items: 4
      }
    }
  });
  $('.product_navactive .nav-link').on('click', function (e) {
    e.preventDefault();
    var $href = $(this).attr('href');
    $('.product_navactive .nav-link').removeClass('active');
    $(this).addClass('active');
    $('.product-details-large .tab-pane').removeClass('active show');
    $('.product-details-large ' + $href).addClass('active show');
  });
  /*---blog active activation---*/

  $('.blog_thumb_active').owlCarousel({
    autoplay: true,
    loop: true,
    nav: true,
    autoplayTimeout: 8000,
    items: 1,
    dots: true,
    navText: ['<i class="fa fa-angle-left"></i>', '<i class="fa fa-angle-right"></i>']
  });
  /*---blog column3 activation---*/

  $('.blog_column3').owlCarousel({
    autoplay: true,
    loop: true,
    nav: true,
    autoplayTimeout: 8000,
    items: 3,
    dots: false,
    navText: ['<i class="fa fa-angle-left"></i>', '<i class="fa fa-angle-right"></i>'],
    responsiveClass: true,
    responsive: {
      0: {
        items: 1
      },
      768: {
        items: 2
      },
      992: {
        items: 3
      }
    }
  });
  dataBackgroundImage();
  $('.slider_area').owlCarousel({
    animateOut: 'fadeOut',
    autoplay: true,
    loop: true,
    nav: false,
    autoplayTimeout: 4000,
    items: 1,
    dots: true
  });
  $('.product_row1').slick({
    centerMode: true,
    centerPadding: '0',
    slidesToShow: 5,
    arrows: true,
    prevArrow: '<button class="prev_arrow"><i class="fa fa-angle-left"></i></button>',
    nextArrow: '<button class="next_arrow"><i class="fa fa-angle-right"></i></button>',
    responsive: [{
      breakpoint: 480,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1
      }
    }, {
      breakpoint: 768,
      settings: {
        slidesToShow: 2,
        slidesToScroll: 2
      }
    }, {
      breakpoint: 992,
      settings: {
        slidesToShow: 3,
        slidesToScroll: 3
      }
    }, {
      breakpoint: 1200,
      settings: {
        slidesToShow: 4,
        slidesToScroll: 4
      }
    }]
  });
});

